    function laip() {

        if(!empty($_SERVER['HTTP_CLIENT_IP'])):
            $ip = $_SERVER['HTTP_CLIENT_IP'];
        elseif(!empty($_SERVER['HTTP_X_FORWARDED_FOR'])) :
            $ip = $_SERVER['HTTP_X_FORWARDED_FOR'];
        else :
            $ip = $_SERVER['REMOTE_ADDR'];
        endif;

        if (preg_match('/,/', $ip)) :
            $realip = explode(',', $ip);
            $ip = $realip[1];
        endif;

        if ($ip == '127.0.0.1' || $ip == '192.168.0.28' || $ip == '192.168.0.3' || $ip == '192.168.0.21' || $ip == '192.168.0.15' || $ip == '192.168.0.23') :
            $ip = '132.157.131.226';
        endif;

        return $ip;

    }

